local demo = {}

local function get_frames(tab)
    local frames = {}
    for i,note in ipairs(tab) do
        local t = note.ticks - 768
        if not frames[t] then frames[t] = {} end
        table.insert(frames[t], note)
    end
    return frames
end

local count = song.ticks

local notes = get_frames(song.note)
local bends = get_frames(song.bend)

local v = {}
for x = 1, 15 do
    v[x] = {}
    for y = 1, 5 do
        v[x][y] = 0
    end
end

function demo.redraw(s, _, g)
    -- g:all(0) 
    for x,_ in ipairs(v) do
        for y,vv in ipairs(v[x]) do
            local lvl = vv > 0 and 15 or ((x == 1 or x == 13) and 4 or 0)
            if lvl > 0 then g:led(
                x,
                8 - y + 1,
                lvl
            ) end
        end
    end
    -- g:refresh()
end

local function g_note(id, on)
    local x = (id)%12 + 1
    local y = (id)//12 + 1 - 2

    if y >= 1 and y <= 5 then
        v[x][y] = on and 1 or 0
    end
    if y == 6 then
        local x = x + 12
        if x <= 15 then
            v[x][5] = on and 1 or 0
        end
    end
    grid_redraw()
end

local loop

function demo.start()
    loop = clock.run(function()
        for i = 1,count do
            do
                local frame = notes[i]
            
                if frame then for _, note in ipairs(frame) do
                    orgn.noteOn(note.num, mu.note_num_to_freq(note.num), 0.9)
                    g_note(note.num, true)

                    clock.run(function()
                        clock.sleep(note.dur)
                        orgn.noteOff(note.num)
                        g_note(note.num, false)
                    end)
                end end
            end
            do
                local frame = bends[i]
                if frame then for _, bend in ipairs(frame) do
                    params:set('pitch', bend.v * 5/12)
                end end
            end

            clock.sync(1/96) -- 96 ppqn
        end
        params:set('demo start/stop', 0)
        redraw()
    end)
end

function demo.stop()
    if loop then clock.cancel(loop) end
    loop = nil
end

function demo.playing()
    return loop and true or false
end

return demo
